import React from 'react';
import {
  Layout, Divider,
} from 'antd';
import './information-user.styles.scss';

import AddAddressUser from './addAddress-user.component';
import FormUser from './form-user.component';

const { Content } = Layout;

class InformationUser extends React.Component {

  componentDidMount() {

  }

  render() {
    return (
      <Layout style={{ padding: '0 24px 24px' }}>
        <Content style={{
          padding: 24,
          margin: 0,
          minHeight: 600,
        }}
        >
          <Divider>
            {' '}
            <h2>Your Informations</h2>
          </Divider>
          <div className="informationUser-container">
            <FormUser />
            <AddAddressUser />
          </div>
        </Content>
      </Layout>
    )
  }
}


export default InformationUser;
